import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, Animated, Easing } from 'react-native';
import cut from "./images/cut.png";



const TopBar = () => {
    return(
        <View style={stylesContainers.container}>
            <View style={stylesContainers.titlev}>
                <Text style={stylesContainers.iksk}>Im Kinsky</Text>
            </View>
            <View style={stylesContainers.ocon}>
                <View style={{paddingRight:10}}>
                    <TouchableOpacity>
                    <View style={{flexDirection:"row",alignItems:"center"}}>
                    <View>
                            <Text style={stylesContainers.gr}>Angemeldete Person </Text>
                    </View>
                    <Image
                        style={stylesContainers.images}
                        source={cut}
                    />

            </View>
            </TouchableOpacity>
            </View>
            </View>
        </View>
    );

};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "row",
        alignItems: 'center',
        width: 1800,
        height: 76,
        borderBottomWidth: 1,          
        borderBottomColor: 'lightgray' 
    },
    titlev: {
        paddingLeft: 30,
    },
    iksk:{
        fontSize: 25,
        color: 'rgba(246,203,108,1)',
        fontWeight: "bold",
    },
    gr:{
        color: "grey",
    },
    ocon:{
        paddingLeft: 1025,
        alignItems: 'center',
        flexDirection: "row",


    },
    images: {

        width: 60,
        height: 60,
    },




});
export default TopBar;
